import 'package:equatable/equatable.dart';

class CustomerList extends Equatable {
	final int? id;
	final String? sceType;
	final String? code;
	final String? customerName;
	final String? tel1;
	final String? tel2;
	final String? mobile;
	final String? fax;
	final String? eMail;
	final String? site;
	final String? address;
	final String? notes;
	final bool? posDefaultCusCash;
	final String? taxRegistrationNo;
	final String? vatNo;

	const CustomerList({
		this.id, 
		this.sceType, 
		this.code, 
		this.customerName, 
		this.tel1, 
		this.tel2, 
		this.mobile, 
		this.fax, 
		this.eMail, 
		this.site, 
		this.address, 
		this.notes, 
		this.posDefaultCusCash, 
		this.taxRegistrationNo, 
		this.vatNo, 
	});

	factory CustomerList.(Map<String, dynamic> json) {
		return CustomerList(
			id: json['id'] as int?,
			sceType: json['sceType'] as String?,
			code: json['code'] as String?,
			customerName: json['customerName'] as String?,
			tel1: json['tel1'] as String?,
			tel2: json['tel2'] as String?,
			mobile: json['mobile'] as String?,
			fax: json['fax'] as String?,
			eMail: json['eMail'] as String?,
			site: json['site'] as String?,
			address: json['address'] as String?,
			notes: json['notes'] as String?,
			posDefaultCusCash: json['posDefaultCusCash'] as bool?,
			taxRegistrationNo: json['taxRegistrationNo'] as String?,
			vatNo: json['vatNo'] as String?,
		);
	}



	Map<String, dynamic> () {
		return {
			'id': id,
			'sceType': sceType,
			'code': code,
			'customerName': customerName,
			'tel1': tel1,
			'tel2': tel2,
			'mobile': mobile,
			'fax': fax,
			'eMail': eMail,
			'site': site,
			'address': address,
			'notes': notes,
			'posDefaultCusCash': posDefaultCusCash,
			'taxRegistrationNo': taxRegistrationNo,
			'vatNo': vatNo,		};
	}

	@override
	List<Object?> get props {
		return [
				id,
				sceType,
				code,
				customerName,
				tel1,
				tel2,
				mobile,
				fax,
				eMail,
				site,
				address,
				notes,
				posDefaultCusCash,
				taxRegistrationNo,
				vatNo,
		];
	}
}
